import React from "react";
import Projects_line from './Projects_line';
import './sub-component'

function Projects_footer() {
    return(
        <>
            {/* <Projects_line/> */}
            <div className="Projects-footer-body">
                <div className="projects-footer-box1"></div>
                <div className="projects-footer-box2"></div>
                <div className="projects-footer-box3"></div>
            </div>

        </>
    );
}
export default Projects_footer;
